          )}
        </ul> */}
        <form >
            <input name="item_name" placeholder="add item name"></input>
            <input name="quantity" placeholder="quantity"></input>
            <button onClick={this.additem.bind(this)}>Add</button>
        </form>
        <CardList/>

      </div>
    );
  }
}

export default Automate;
